import React from 'react'
import { NavLink } from 'react-router-dom'
import HomePage from './HomePage'

export default function Navbar() {
    return (
      <nav>
          <NavLink to='/HomePage'>
              <p>Home</p>
          </NavLink>
      </nav>
      )
  }
